import { API } from "@/utils/request"

export async function getLatestBugs() {
    try{
        const response = await API.get('/bugs/latest-bugs');
        return response.data;
    }catch(e){
        throw new Error('Error fetching KMap data'+ e.message);
    }
}

export const getKMapData = async () => {
  try {
    const response = await API.get('/bugs/k-map-data/');
    return response.data;
  } catch (error) {
    throw new Error('Error fetching KMap data:', error);
  }
};
